import React, { useState } from 'react';
import axios from 'axios';
import './DataInputForm.css';

const DataInputForm = () => {
    const [formData, setFormData] = useState({
        type: 'transportation',
        emissions: '',
        details: {
            description: ''
        }
    });
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [success, setSuccess] = useState('');

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');
        setSuccess('');

        try {
            const token = localStorage.getItem('token');
            if (!token) {
                throw new Error('No authentication token found');
            }

            console.log('Sending data:', formData); // Debug log

            const response = await axios.post(
                'http://localhost:5000/api/data/add',
                formData,
                {
                    headers: {
                        'Authorization': `Bearer ${token}`,
                        'Content-Type': 'application/json'
                    }
                }
            );

            console.log('Response:', response.data); // Debug log
            setSuccess('Data added successfully!');
            
            // Clear form
            setFormData({
                type: 'transportation',
                emissions: '',
                details: {
                    description: ''
                }
            });
        } catch (err) {
            console.error('Error details:', err.response || err); // Debug log
            setError(err.response?.data?.message || 'Error adding data. Please try again.');
        } finally {
            setLoading(false);
        }
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        if (name === 'description') {
            setFormData(prev => ({
                ...prev,
                details: {
                    ...prev.details,
                    description: value
                }
            }));
        } else {
            setFormData(prev => ({
                ...prev,
                [name]: value
            }));
        }
    };

    return (
        <div className="data-input-form">
            <h2>Add Carbon Footprint Data</h2>
            
            {error && (
                <div className="error-message" style={{ color: 'red', marginBottom: '1rem' }}>
                    {error}
                </div>
            )}
            {success && (
                <div className="success-message" style={{ color: 'green', marginBottom: '1rem' }}>
                    {success}
                </div>
            )}
            
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label htmlFor="type">Activity Type</label>
                    <select
                        id="type"
                        name="type"
                        value={formData.type}
                        onChange={handleChange}
                        required
                    >
                        <option value="transportation">Transportation</option>
                        <option value="electricity">Electricity</option>
                        <option value="food">Food</option>
                        <option value="other">Other</option>
                    </select>
                </div>

                <div className="form-group">
                    <label htmlFor="emissions">Emissions (kg CO2)</label>
                    <input
                        type="number"
                        id="emissions"
                        name="emissions"
                        value={formData.emissions}
                        onChange={handleChange}
                        required
                        min="0"
                        step="0.01"
                        placeholder="Enter emissions in kg CO2"
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="description">Description</label>
                    <textarea
                        id="description"
                        name="description"
                        value={formData.details.description}
                        onChange={handleChange}
                        placeholder="Enter activity description"
                        rows="3"
                    />
                </div>

                <button 
                    type="submit" 
                    disabled={loading}
                    className={loading ? 'loading' : ''}
                >
                    {loading ? 'Adding...' : 'Add Data'}
                </button>
            </form>
        </div>
    );
};

export default DataInputForm;
